import axios from "axios";
import { GET_DATA_AWAL, GET_DATA_SUCSSES, GET_DATA_FAIL } from "./actionTypes";

export const getData = (data) => (dispatch) => {
  dispatch({
    type: GET_DATA_AWAL,
    Loading: true,
    Error: null,
  });

  try {
    const res = axios.post(
      "https://eli-uat-api.myequity.id/mobmyelife/services/api/v1/login",
      data
    );
    dispatch({
      type: GET_DATA_SUCSSES,
      payload: res.data
    });

    console.log(res.PromiseResult)
  } catch (error) {
    console.log(error);
    dispatch({
      type: GET_DATA_FAIL,
      payload : error
    });
  }
};
